            //we need to perform this 26 times

            string returntext;
            
            int counter = 0;
            string characters = "abcdefghijklmnopqrstuvwxyz";
            string trimmedproblem = "";
            int maxLetterIndex = -1;

            int maxLetterProblemLength = 0;
            for (int c = 0; c < 26; c++)
            {

                trimmedproblem = problem.Replace(characters.Substring(c, 1), "");
                trimmedproblem = trimmedproblem.Replace(characters.Substring(c, 1).ToUpper(), "");
                Console.WriteLine(trimmedproblem.Length);
                int currentProblemLength = react(trimmedproblem);
                if (currentProblemLength < maxLetterProblemLength)
                {
                    
                    maxLetterIndex = c;
                    maxLetterProblemLength = currentProblemLength;
                }
            }
            return "The most common type was [" + characters.Substring(maxLetterIndex,1) + "], and the final polymer is <b>[" + maxLetterProblemLength+"]</b> units";

